import { faPenToSquare, faTrash } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React from "react";

const ToDo = (props) => {
  const handleSubmit = () => {
    props.removedElement(props.id);
  };

  return (
    <div>
      <div className="Todo">
        <p>{props.task}</p>
        <div>
          <FontAwesomeIcon icon={faPenToSquare} />
          <FontAwesomeIcon icon={faTrash} onClick={handleSubmit} />
        </div>
      </div>
    </div>
  );
};

export default ToDo;
